// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "./Melody.sol";
import "./Track.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract TrackProxy is Ownable {
	Melody token;
	Track track;
	uint256 registration_fee;

	event FeePayed(address payer, uint256 fee);

	modifier canRegisterSong() {
		require(token.balanceOf(msg.sender) >= registration_fee, "Not enough funds to register a song");
		_;
	}

	constructor(Melody _token, Track _track, uint256 _registration_fee) {
		token = _token;
		track = _track;
		registration_fee = _registration_fee * 1 ether;
	}

	function uint2str(uint _i) internal pure returns (string memory _uintAsString) {
        if (_i == 0) {
            return "0";
        }
        uint j = _i;
        uint len;
        while (j != 0) {
            len++;
            j /= 10;
        }
        bytes memory bstr = new bytes(len);
        uint k = len;
        while (_i != 0) {
            k = k-1;
            uint8 temp = (48 + uint8(_i - _i / 10 * 10));
            bytes1 b1 = bytes1(temp);
            bstr[k] = b1;
            _i /= 10;
        }
        return string(bstr);
    }

	function payRegistrationFee() internal {
		//token.approve(address(this), registration_fee);
		//token.increaseAllowance(address(this), song_registration_fee);
		token.transferFrom(msg.sender, address(this), registration_fee);
		require(false, "funds moving completed");
		emit FeePayed(msg.sender, registration_fee);
	}

	function registerTrack(address musician, string memory tokenURI) public canRegisterSong {
		payRegistrationFee();
		track.registerTrack(musician, tokenURI);
	}

	function getBalance() public view returns(uint256) {
		return token.balanceOf(address(this));
	}
}
